		// the right subtree.
		if (root.left !== null) {
			assert(root.left instanceof Node);
			yield* inordertraversal(root.left);
		}

		yield root.key;
		if (root.right !== null) {
			assert(root.right instanceof Node);
			yield* leftOpenRangeTraversal(compare, root.right, right);
		}
	}
